import React from "react";
import { Card, Col, Container, Row } from "react-bootstrap";

const Product = () => {
  return (
    <Container className="shop-app-product">
      <Row>
        <Col>
          <Card>
            <Card.Img src="https://images-na.ssl-images-amazon.com/images/I/71RZxhZXb2L.jpg"></Card.Img>
            <Card.Body>
              <Card.Title>Indian Saree</Card.Title>
              <div className="pricing">
                <div className="regular">350</div>
                <div className="">250</div>
              </div>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
};

export default Product;
